    def click(self):
        #calculate cost
        if self.comboBox.currentText() == "Ender 3":
            cost_machine_type = 1
            electric_consume = 0.08
        elif self.comboBox.currentText() == "Ender 3 Pro":
            cost_machine_type = 2
            electric_consume = 0.08
        elif self.comboBox.currentText() == "Ender CR 10":
            cost_machine_type = 2
            electric_consume = 0.10
        elif self.comboBox.currentText() == "Qidi Max":
            cost_machine_type = 2
            electric_consume = 0.12
        
        cost_filament = (self.filament_cost.value()/1000)*25
        cost_labour = 0.30
        cost_maintenance = 0.5
        cost_print_time = self.print_time.value()*0.3
        cost_electricity = self.print_time.value()*electric_consume
        
        cost_total = cost_machine_type + cost_filament + cost_labour + cost_maintenance + cost_print_time + cost_electricity

        #set value to display
        self.machine_type_cost.display(cost_machine_type)
        self.filament_cost_2.display(cost_filament)
        self.labour_cost.display(cost_labour)
        self.maintenace_cost.display(cost_maintenance)
        self.print_time_cost.display(cost_print_time)
        self.electric_cost.display(cost_electricity)
        self.final_cost.display(cost_total)



